  //       <img className="player-photo" src={props.photo} />
  //     </div>
  //   );
  // }

  var matchInfo = ["2023-04-01", "18:00UTC", "DPlus", "SANDBOX"]

  return (
    <div id="teams">
      <div id="section-name">
        <div className="dividing-line"></div>
        <p>Match</p>
        <div className="dividing-line"></div>
      </div>
      <div id="wrap">
        <div id="teams-body">
          <div id="title">
            <p>DATE</p>
            <p>TIME</p>
            <p>MATCH</p>
          </div>
          <div id="matches">
            {() => {
              return (
                <div className="match">

                </div>
              );
            }}
          </div>
        </div>
      </div>
    </div>
  )
}

export default Match;
